import './index.css'
import { Link } from "react-router-dom";
import axios from 'axios'

export default function SignUpBarBtn(props) {

  const logOut = () => {
    return axios.get('/logout');
  }

  return (
    <div> 
      <Link to={props.link} className="SignUpLink">
        <div className="logInBtn">
          <p>{props.text}</p>
        </div>
      </Link>
    </div>
  )
}
